import React, { useState } from "react";
import "./styles.css";

const EmailComponent = () => {
  const [email, setEmail] = useState("");

  return (
    <div>
      <input
        className="Layout"
        type="text"
        placeholder="Enter an email"
        onChange={(e) => setEmail(e.target.value)}
      />
    </div>
  );
};

export default EmailComponent;
